import './ExpenseItem.css';

function ExpenseItem(props) {
    // const expenseDate = new Date(2021, 2, 28);
    // const expenseTitle = "Personal Insurance";
    // const expenseAmount = 444.44;

    return <div className="expense-item">
        <div>
            <div>{props.date.toLocaleString('en', {month: 'long'})}</div>
            <div>{props.date.toLocaleString('en', {Year: 'numeric'})}</div>
            <div>Date</div>
        </div>
        <div className="expense-item__description">
            <h2>{props.title}</h2>
            <div className="expense-item__price">${props.amount}</div></div>
    </div>
}

export default ExpenseItem;
